// 官方解法一：使用柱状图的优化暴力方法，88 ms，12.5 MB
class Solution {
public:
	int maximalRectangle(vector<vector<char>>& matrix) {
		int m = matrix.size();
		if (m == 0) {
			return 0;
		}
		int n = matrix[0].size();
		vector<vector<int>> left(m, vector<int>(n, 0));

		for (int i = 0; i < m; ++i) {
			for (int j = 0; j < n; ++j) {
				if (matrix[i][j] == '1') {
					left[i][j] = (j == 0 ? 0 : left[i][j - 1]) + 1;
				}
			}
		}

		int ret = 0;
		// 逐个检测以matrix[i][j]为全1矩阵右下角的矩形
		for (int i = 0; i < m; ++i) {
			for (int j = 0; j < n; ++j) {
				if (matrix[i][j] == '0') {
					continue;
				}
				int width = left[i][j];
				int area = width;
				for (int k = i - 1; k >= 0; --k) {
					width = min(width, left[k][j]);
					area = max(area, (i - k + 1) * width);
				}
				ret = max(ret, area);
			}
		}
		return ret;
	}
};

// 官方解法二：单调栈，40 ms，16.1 MB
class Solution {
public:
	int maximalRectangle(vector<vector<char>>& matrix) {
		int m = matrix.size();
		if (m == 0) {
			return 0;
		}
		int n = matrix[0].size();
		vector<vector<int>> left(m, vector<int>(n, 0));

		for (int i = 0; i < m; ++i) {
			for (int j = 0; j < n; ++j) {
				if (matrix[i][j] == '1') {
					left[i][j] = (j == 0 ? 0 : left[i][j - 1]) + 1;
				}
			}
		}

		int ret = 0;
		for (int j = 0; j < n; ++j) {
			vector<int> up(m, 0), down(m, 0);
			stack<int> stk;
			for (int i = 0; i < m; ++i) {
				while (!stk.empty() && left[stk.top()][j] >= left[i][j]) {
					stk.pop();
				}
				up[i] = stk.empty() ? -1 : stk.top();
				stk.push(i);
			}
			stk = stack<int>();
			for (int i = m - 1; i >= 0; --i) {
				while (!stk.empty() && left[stk.top()][j] >= left[i][j]) {
					stk.pop();
				}
				down[i] = stk.empty() ? m : stk.top();
				stk.push(i);
			}
			for (int i = 0; i < m; ++i) {
				int area = (down[i] - up[i] - 1) * left[i][j];
				ret = max(ret, area);
			}
		}
		return ret;
	}
};

